import random

def main():
    N = int(input())
    A = list(map(int, input().split()))
    while len(A) > 1:
        a = random.randint(0, len(A)-1)
        b = random.randint(0, len(A)-1)
        if a == b:
            continue
        A[b] -= A[a]
        if A[b] <= 0:
            A.pop(b)
    print(A[0])

if __name__ == '__main__':
    main()

